import Player from './Player';


function App() {
  return (
    <div>
      <header className="App-header">
        <h1>Board Game Clock</h1>
      </header>
      <div className="Player">
        <Player
            PlayerName = {'Kieran'}
            Position = {1}
            SecsLeft = {130}
        />
      </div>
    </div>
  );
}

export default App;
